import Constants from "./Constants";

const EndPoints = {
    CATEGORY_URL : `${Constants.BASE_URL}products/categories/`,
    PRODUCTS_LIST_URL: `${Constants.BASE_URL}products/`,
    PRODUCTS_BASED_ON_CATEGORY_URL: `${Constants.BASE_URL}products/category`
}

export default EndPoints;
